  `id` varchar(36) NOT NULL COMMENT '主键',
  `back_car_time` datetime DEFAULT NULL COMMENT '预计还车时间',
  `by_car_time` datetime DEFAULT NULL COMMENT '预计取车时间',
  `insurance_company` varchar(255) DEFAULT NULL COMMENT '保险公司',
  `insurance_money` decimal(11,2) DEFAULT NULL COMMENT '保险费用',
  `order_num` varchar(100) DEFAULT NULL COMMENT '订单号',
  `rent` decimal(11,2) DEFAULT NULL COMMENT '租金',
  `rent_car_money` decimal(11,2) DEFAULT NULL COMMENT '租车押金',
  `total_money` decimal(11,2) DEFAULT NULL COMMENT '总费用(保险+租金)',
  `trade_num` varchar(255) DEFAULT NULL COMMENT '支付宝或银联的交易号---支付租金/保险（可以根据payType区分）',
  `tradeNumUPMP` varchar(100) DEFAULT NULL COMMENT '银联的交易号---支付押金',
  `car_userid` varchar(36) NOT NULL COMMENT '车主用户ID',
  `rent_userid` varchar(36) NOT NULL COMMENT '租车用户ID',
  `car_id` varchar(36) NOT NULL COMMENT '车辆ID',
  `order_state` int(11) DEFAULT NULL COMMENT '订单状态 0：已下单(未付款等待车主确认),1车主确认(未付款) , 2:已付款 (未支付押金), 3已支付押金(取车中),4: 已取车   ,5:租客确认已还车 ,6车主确认已还车(已完成),7：过期,8:取消,9已结算',
  `expirationDate` datetime DEFAULT NULL COMMENT '订单过期时间',
  `ownerDate` datetime DEFAULT NULL COMMENT '车主确认订单开始时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `reality_backcar_time` datetime DEFAULT NULL COMMENT '实际还车时间',
  `reality_bycar_time` datetime DEFAULT NULL COMMENT '实际取车时间',
  `city_id` varchar(255) DEFAULT NULL COMMENT '城市id',
  `carPhone` varchar(255) DEFAULT NULL COMMENT '车主电话',
  `carUserName` varchar(255) DEFAULT NULL COMMENT '车主姓名',
  `rentPhone` varchar(255) DEFAULT NULL COMMENT '租客电话',
  `rentUserName` varchar(255) DEFAULT NULL COMMENT '租客姓名',
  `messageState` int(10) DEFAULT NULL COMMENT '收取押金短信是否已发送(0未发送，1已发送)',
  `cancelPerson` int(11) DEFAULT NULL COMMENT '取消人的类型：0是车主，1是租客',
  `collection_money` decimal(11,2) DEFAULT '0.00' COMMENT '待收金额',
  `back_money` decimal(11,2) DEFAULT '0.00' COMMENT '待退金额',
  `money_state` int(11) DEFAULT NULL COMMENT '押金（预授权）处理情况:0:已完成,1:未处理,2:已撤销,3:未收取',
  `rentCommentType` varchar(5) DEFAULT NULL COMMENT '租客评价  0未评价，1已评价',
  `carCommentType` varchar(5) DEFAULT NULL COMMENT '车主评价  0未评价，1已评价',
  `payType` int(5) DEFAULT NULL COMMENT '租金/保险支付类型(1:支付宝，2银联)',
  `byCarAppType` varchar(5) DEFAULT NULL COMMENT '车主/租客是否收到取车通知(0没有收到，1已收到)',
  `backCarAppType` varchar(5) DEFAULT NULL COMMENT '车主/租客是否收到还车通知(0没有收到，1已收到)',
  `carPlateNum` varchar(255) DEFAULT NULL COMMENT '车牌号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `FKA0C0C3C3700F839D` (`rent_userid`),
  KEY `FKA0C0C3C3E2690AA2` (`car_userid`),
  KEY `FKA0C0C3C39B52E0A5` (`car_id`),
  CONSTRAINT `FKA0C0C3C3700F839D` FOREIGN KEY (`rent_userid`) REFERENCES `t_base_user` (`id`),
  CONSTRAINT `FKA0C0C3C39B52E0A5` FOREIGN KEY (`car_id`) REFERENCES `t_car` (`id`),
  CONSTRAINT `FKA0C0C3C3E2690AA2` FOREIGN KEY (`car_userid`) REFERENCES `t_base_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

