DROP VIEW IF EXISTS `v_car`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_car` AS select distinct `car`.`id` AS `id`,`img`.`image_pic` AS `image_pic`,`img`.`car_id` AS `car_id`,`img`.`is_top` AS `is_top`,`car`.`address` AS `address`,`car`.`car_config` AS `car_config`,`car`.`car_emissions` AS `car_emissions`,`car`.`car_name` AS `car_name`,`car`.`car_state` AS `car_state`,`car`.`insurance_pic` AS `insurance_pic`,`car`.`latitude` AS `latitude`,`car`.`longitude` AS `longitude`,`car`.`mileage` AS `mileage`,`car`.`money` AS `money`,`car`.`not_rent_time` AS `not_rent_time`,`car`.`note` AS `note`,`car`.`number` AS `number`,`car`.`plate_num` AS `plate_num`,`car`.`transmission` AS `transmission`,`car`.`vehicle_license` AS `vehicle_license`,`car`.`car_year` AS `car_year`,`car`.`user_id` AS `user_id`,`car`.`category_id` AS `category_id`,`car`.`by_car_info` AS `by_car_info`,date_format(`car`.`create_time`,'%Y-%m-%d %H:%i:%s') AS `create_time`,`car`.`car_desc` AS `car_desc`,`img`.`id` AS `img_id`,`t_car_category`.`cate_name` AS `cate_name`,`u`.`phone` AS `phone`,`u`.`user_name` AS `user_name`,`car`.`city` AS `city` from (((`t_car` `car` left join `t_car_image` `img` on(((`img`.`is_top` = 1) and (`img`.`car_id` = `car`.`id`)))) left join `t_car_category` on((`car`.`category_id` = `t_car_category`.`id`))) left join `t_base_user` `u` on((`car`.`user_id` = `u`.`id`))) ;

