DROP EVENT IF EXISTS `e_updateOrderState`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` EVENT `e_updateOrderState` ON SCHEDULE EVERY 20 SECOND STARTS '2014-08-18 15:21:01' ON COMPLETION NOT PRESERVE ENABLE DO CALL updateState()
;;
