DROP TRIGGER IF EXISTS `trg_update_orderState`;
DELIMITER ;;
CREATE TRIGGER `trg_update_orderState` BEFORE UPDATE ON `tx_order` FOR EACH ROW BEGIN
    IF (NEW.type !=OLD.type&&NEW.type='3') THEN
   update t_order a set a.order_state=4 where a.id=OLD.order_id;
  END IF; 
    END
;;
DELIMITER ;
